import Task from "./Task";
import { FaArrowUp, FaArrowDown } from "react-icons/fa";
const LongTasks = ({ tasks, onDelete, onToggle, showLong, onShow }) => {
  return (
    <>
      <h2 onClick={onShow} style={{ background: "lightblue" }}>
        Long Term Tasks
        {showLong ? <FaArrowUp /> : <FaArrowDown />}
      </h2>
      {tasks.map(
        (task) =>
          task.type === "long" &&
          showLong && (
            <Task
              key={task.id}
              task={task}
              onDelete={onDelete}
              onToggle={onToggle}
              onshow={onShow}
            ></Task>
          )
      )}
    </>
  );
};

export default LongTasks;
